import { Box, Button, IconButton, Typography, useTheme, ListItemIcon } from "@mui/material";
import { tokens } from "../../theme";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import { useState } from "react";
import { ExpandMore } from "@mui/icons-material";



const Dashboard = () => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);

  // a state variable to keep track of the anchor element for the dropdown menu. This variable will be null initially and will be updated when the user clicks on the box
  const [anchorEl, setAnchorEl] = useState(null);

  //two functions, one to handle the opening of the dropdown menu and another to handle the closing of the dropdown menu.
  const handleOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };


//handles the text input for the "growing degree days" boxes
  const [startDate, setStartDate] = useState("");
//handles the text input for the "growing degree days" boxes
  const [endDate, setEndDate] = useState("");
//handles the text input for the "growing degree days" boxes
  const handleStartDateChange = (event) => {
    setStartDate(event.target.value);
  };
//handles the text input for the "growing degree days" boxes
  const handleEndDateChange = (event) => {
    setEndDate(event.target.value);
  };


  return (
    <box style={{ display: 'flex', flexDirection: 'row' }}>
      {/*first column*/}
      <box style={{ display: 'flex', flexDirection: 'column' }}>
      {/* FieldDock Logo BOX start*/}
          <Box
            display="flex"
            justifyContent="center"
            alignItems="center"
            width="700px"
            height="200px"
            backgroundColor="transparent"
            borderRadius="10px"
            // style={{ marginLeft: "200px" }}
          >
            <object 
              data="../../assets/FieldDock-Logo.svg" 
              type="image/svg+xml" 
              style={{ maxWidth: "100%", maxHeight: "100%" }}
              width="700px"
              height="200px"
            >
            </object>
          </Box>
          {/* FieldDock Logo BOX end */}


          {/* "Select FieldDock System....START" */}
          <>
          <Box 
            onClick={handleOpen}
            sx={{ border: "1px solid #00e1b4", borderRadius: "4px", padding: "10px" }}
            display="flex"
            justifyContent="space-between" // set the horizontal spacing between child elements
            alignItems="center"
            width="700px"
            height="50px"
            backgroundColor="transparent"
            borderRadius="10px"
            fontSize={"20px"}
            // style={{ marginLeft: "200px" }}



          >
            Select FieldDock System...
            <ListItemIcon>
              <ExpandMore />
            </ListItemIcon>
          </Box>
          <Menu 
            anchorEl={anchorEl} 
            open={Boolean(anchorEl)} 
            onClose={handleClose}
          >
            <MenuItem 
              onClick={handleClose}
              sx={{ color: "#000000", backgroundColor: "#BEBEBE", "&:hover": { backgroundColor: "#EBECF0" } }}
            >
              FieldDock 0001

            </MenuItem>
            <MenuItem 
              onClick={handleClose}
              sx={{ color: "#000000", backgroundColor: "#BEBEBE","&:hover": { backgroundColor: "#EBECF0" } }}
            >
                FieldDock 0002
            </MenuItem>
            <MenuItem 
              onClick={handleClose}
              sx={{ color: "#000000", backgroundColor: "#BEBEBE", "&:hover": { backgroundColor: "#EBECF0" } }}
            >
              FieldDock 0003
            </MenuItem>
          </Menu>
        </>
          {/* "Select FieldDock System....END" */}



        {/* Growing Degree Days....START */}
          <Box  //main outside box
            style={{
              border: "1px solid #CCC",
              padding: "10px",
              position: "relative",
              marginTop: "2rem",
              width: "700px",
              height: "100px",
              // marginLeft: "200px",
              borderRadius: "10px",
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            <Box
              style={{
                position: "absolute",
                top: "-15px",
                left: "50%",
                transform: "translateX(-50%)",
                backgroundColor: "#000000",
                padding: "0 5px",
                zIndex: 1,
                fontSize: "20px",
              }}
            >
              Growing Degree Days
            </Box>
            <Box //start date box
            style={{
              border: "1px solid #CCC",
              width: "25%",
              height: "50px",
              display: "inline-block",
              borderRadius: "5px",
              fontSize: "20px",
              marginRight: "10px",
            }}
          >
            <input 
              type="text" 
              style={{ 
                width: "100%", 
                height: "100%", 
                border: "none", 
                background: "none", 
                color: "#999", 
                fontSize: "20px", 
                textAlign: "center",
                outline: "none",
              }} 
              placeholder="Start Date" 
              value={startDate}
              onChange={handleStartDateChange}
            />
          </Box>
          <Box //end date box
            style={{ 
              border: "1px solid #CCC",
              width: "25%",
              height: "50px",
              display: "inline-block",
              borderRadius: "5px",
              fontSize: "20px",
              marginRight: "10px",
            }}
          >
            <input 
              type="text" 
              style={{ 
                width: "100%", 
                height: "100%", 
                border: "none", 
                background: "none", 
                color: "#999", 
                fontSize: "20px", 
                textAlign: "center",
                outline: "none",
              }} 
              placeholder="End Date"
              value={endDate}
              onChange={handleEndDateChange} 
              />
            </Box>
            <Box //box for Enter button 
              style={{
                border: "1px solid #f59331",
                width: "25%",
                height: "50px",
                display: "inline-block",
                borderRadius: "5px",
              }}
            >
              <button 
                style={{ 
                  width: "100%", 
                  height: "100%", 
                  border: "none", 
                  background: "none", 
                  color: "#ffffff", 
                  borderRadius: "10px", 
                  fontSize: "20px",
                  cursor: "pointer",
                }}
              >
                Enter
              </button>
            </Box>
              <Box  //box for GDD and 000 measurement 
                style={{
                  width: "25%",
                  height: "40px",
                  display: "flex",
                  flexDirection: "column",
                  justifyContent: "center",
                  alignItems: "center",
                  borderRadius: "5px",
                }}
              >
                <Box
                  style={{
                    color: "#FFF",
                    fontSize: "18px",

                  }}
                >
                  GDD:
                </Box>
                <Box
                  style={{
                    color: "#999",
                    fontSize: "20px",
                  }}
                >
                  000
                </Box>
              </Box>
            </Box>
          {/* Growing Degree Days....END" */}





          {/* Misc START */}
          <Box  //main outside box
            style={{
              border: "1px solid #CCC",
              padding: "10px",
              position: "relative",
              marginTop: "2rem",
              width: "700px",
              height: "100px",
              // marginLeft: "200px",
              borderRadius: "10px"
            }}
          >
            <Box
              style={{
                position: "absolute",
                top: "-15px",
                left: "50%",
                transform: "translateX(-50%)",
                backgroundColor: "#000000",
                padding: "0 5px",
                zIndex: 1,
                fontSize: "20px"
              }}
            >
              Misc
            </Box>
            <Box
              style={{
                borderTop: "none",
                borderLeft: "none",
                borderRight: "none",
                position: "absolute",
                top: "18px",
                left: "0",
                width: "100%",
                height: "calc(100% - 18px)",
                zIndex: 0,
              }}
            />
              <>
                <Box 
                  onClick={handleOpen}
                  sx={{ border: "1px solid #00e1b4", borderRadius: "4px", padding: "10px" }}
                  display="flex"
                  justifyContent="space-between" // set the horizontal spacing between child elements
                  alignItems="center"
                  width="660px"
                  marginTop="1rem"
                  height="30px"
                  backgroundColor="transparent"
                  borderRadius="10px"
                  fontSize={"17px"}
                  style={{ marginLeft: "10px" }}



                >
                  Select a sensor...
                  <ListItemIcon>
                    <ExpandMore />
                  </ListItemIcon>
                </Box>
                <Menu 
                  anchorEl={anchorEl} 
                  open={Boolean(anchorEl)} 
                  onClose={handleClose}
                >
                  <MenuItem 
                    onClick={handleClose}
                    sx={{ color: "#000000", backgroundColor: "#BEBEBE", "&:hover": { backgroundColor: "#EBECF0" } }}
                  >
                    FieldDock 0001

                  </MenuItem>
